import React, { Fragment } from "react";
import classes from './ProfileContent.module.css'

const ProfileContent = ({type, children, info}) => {

    const count = info.length;
    const components = [];

    const progLangs = [];

    if(type === 'programmingLang'){
        info.programmingLanguages.map((output, id) => {
            progLangs.push(<>
                <span className={classes.code_lang}>
                    <span className={classes.circle} style={{ backgroundColor: props.output.programmingLanguage.color }}></span>
                    {props.output.programmingLanguage.name}
                </span>
            </>)
        })
    }


    for (let i = 0; i < count; i++) {
    components.push(<Fragment key={i}>*</Fragment>);
    }

    return(
        <Fragment>
            {type === 'password' ? (
                <>
                    <p className={classes.label}>{children}</p>
                    <p className={classes.info}>{components}</p>
                </>
            ):
            (
                <>
                    <p className={classes.label}>{children}</p>
                    <p className={classes.info}>{info}</p>
                </>
            )}
        </Fragment>
    )

}

export default ProfileContent;
